import "./App.css";
import "bootstrap/dist/css/bootstrap.min.css";

import { Routes, Route, BrowserRouter } from "react-router-dom";

import { Landing } from "./components/Landing";
import { Study1 } from "./components/questions/Study1";
import { Study2 } from "./components/questions/Study2";

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route exact path="/" element={<Landing />} />
        <Route path="/study/3" element={<Study1 />} />
        <Route path="/study/4" element={<Study2 />} />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
